import { Route } from "@mui/icons-material";
import { BrowserRouter, Routes } from "react-router-dom";
import MainLayout from "./components/common/layout/MainLayout";

function App() {
  return (
    <BrowserRouter>
     <Routes>
      <Route path="/" element={<MainLayout />}>

      </Route>
     </Routes>
    </BrowserRouter>
  );
}

export default App;
